*/
import { CommonAppLogoRenderFunction } from 'js/CommonAppLogoService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/CommonAppLogoService', () => import('js/CommonAppLogoService'));;

/*
view model
 */
