    "schemaVersion": "1.0.0",
    "data": {
        "appLogo": "assets/image/logoMiniLauncher32.svg"
    },
    "actions": {
        "render": {
            "method": "CommonAppLogoRenderFunction",
            "deps": "js/CommonAppLogoService"
        }
    },
    "onEvent": [],
    "i18n": {},
    "messages": {},
    "conditions": {},
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "CommonAppLogo",
    "_uniqueViewModelId": "CommonAppLogo",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, CommonAppLogoRenderFunction, undefined, ctxImportObj );

export default Component;
